;; **
;;; Some test data, a simple polynomial sampled on an equally spaced x-y grid.
;; **

;; @@
(def xys (outer (range 0.0 1.0 0.1) (range 0.0 1.0 0.1)))


(def test-data (mapv (fn [[x y]] (+ x y (* x x y) (* y y y y x) (* x y x x y) (* x y) (* y y) (* x x x))) xys))

; 
; xy + x^2 + y^3    - [1 0] [0 1] [2 0] [0 3]

; xy +x^2y^2

(def test-data-2 (mapv (fn [[x y]] (+ (* x y) (* (* x x ) (* y y)))) xys))
