;; **
;;; A function to calculate the value of a single term in the polynomial, at a particular value of the coordinates.
;; **

;; @@
;; Don't include constant terms here, that is x^0 == 0, not 1
;; Otherwise we would have potentially many constant terms.

(defn calculate-term-value
  [coord term]
  (apply * (mapv (fn [power value]
                  (if (zero? power)
                    1.0
                    (Math/pow value power)))
                term coord)))

(mapv (fn [value pow] (Math/pow value pow)) [1 2] [5.0 4.0])

