;; **
;;; This function uses the above to run incanter's linear fit on the data.
;; **

;; @@
(defn fit-poly
  [poly coords values]
  (stats/linear-model values (calculate-term-matrix coords poly)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/fit-poly</span>","value":"#'regression-test-score/fit-poly"}
;; <=

;; **
;;; Testing it out. The test polynomial has just the right terms, so this should give us a perfect fit. The fit routine spits out a load of junk.
;; **

;; @@
;(fit-poly [[1 3] [2 1] [1 1] [1 2]] xys test-data)

;(fit-poly [[1 1] [2 2] ] xys test-data-2)
;; @@

;; **
;;; Wrap this up in a function that just pulls out the summed-square-error, which we'll use as our score.
;; **

;; @@
(defn poly-score
  [poly coords values]
  (:sse (fit-poly poly coords values)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/poly-score</span>","value":"#'regression-test-score/poly-score"}
;; <=

;; **
;;; Test it out on a few different polynomials.
;; **

;; @@
(poly-score [[1 0] [1 1] ] xys test-data)
(poly-score [[1 1] [8 0] [1 7] [0 7] [3 7] [3 2]] xys test-data)

(poly-score [[1 1] [2 2]] xys test-data-2)

(poly-score [[0 1] [1 0] [0 2] [3 0]] xys test-data)

(poly-score [[2 1]] xys test-data-2)
